import data from "../data"; 

const DisplayFastFacts = (props)=> {
    console.log(data.idd[0]);
    let countryName = data.name.official;
    let population = data.population;
    let capital = data.capital[0];
    let region = data.region;
    let currency = data.currencies[Object.keys(currencies)[0]].name;
    return (
        <div className="fastFactsContainer">
            <div className="fastFactCountryInfo">
                <img alt="country" src={data.flags.png}></img>
                <h1 className="countryName">{countryName}</h1>
                <h3>Population: {population}</h3>
                <h3>Capital: {capital}</h3>
                <h3 >Region: {region}</h3>
                <h3>Currency: {currency}</h3>
            </div>
        </div>
        );

} 
